const inputStr = '19617804207202209144916044189917';
let input = inputStr.split('').map(str => parseInt(str));

offset = parseInt(input.slice(0, 7));

function desiredIndex(i, pos) {
	const pattern = [0, 1 , 0, -1];
	const index = Math.floor((i + 1)/pos)%pattern.length;
	return pattern[index];
}

function calculate(inp) {
	let out = [];	
	for (let pos = 1; pos <= input.length; pos++) {
		let sum = 0;
		for (let i = 0; i < input.length; i++) {
			sum += desiredIndex(i, pos) * inp[i]
		}

		sum = Math.abs(sum);
		out.push(sum % 10);
	}
	return out;
}

for (let i = 0; i < 100; i++) {
	input = calculate(input);
}

console.log(input);
